import React from 'react';
import Auth from '../Auth';
import s from '../styles/Start.module.css';
const Start = () => {
  return (
    <div className={s.container}>
      <div className={s.wrapper}>
        <h1 style={{ color: 'white', marginBottom: '10px' }}>
          Welcome to Venus
        </h1>
        <p
          style={{ color: 'white', marginBottom: '10px', textAlign: 'center' }}
        >
          Venus is a digital technology that facilitates the sharing of content,
          multimedia, and information through virtual networks and communities.
        </p>
        <Auth />
      </div>
    </div>
  );
};

export default Start;
